import Navbar from './Navbar'
import Head from 'next/head'

const Layout = (props) =>(
    <div>
        <Head>
            <title>My App</title>
            <meta keywords = "For Seo"></meta>
            <link rel = "stylesheet" href = "https://bootswatch.com/4/darkly/bootstrap.css" />
        </Head>
        <Navbar />
        <hr />
        <hr />
        {props.children}
    </div>
);

export default Layout;
